import NewPropertyForm from "../component/properties/NewPropertyForm";
import axios from "axios"
import { useState, useEffect } from "react";
function NewPropertyPage() {
  const [isLoaded, setIsLoading] = useState(false);
  const [loadedProp, setLoadedProp] = useState([]);

  useEffect(() => {
    axios.post('http://localhost:3002/properties', loadedProp)
    .then(() => {
      setIsLoading(false)
    })
    }, [!loadedProp]);
  function addPropHandler(formData){
    setLoadedProp(formData);
    setIsLoading(true)
    // axios('http://localhost:3002/properties',
    // {
    //   method:'POST',
    //   body: JSON.stringify(formData),
    //   headers:{
    //     'Content-Type': 'application/json'
    //   }
    // });
  }
  return <section>
      <h1>Add new property</h1>
      <NewPropertyForm onAddProp={addPropHandler}/>
  </section>;
}

export default NewPropertyPage;
